import React, { Component } from "react";
class BackIcon extends Component {
  state = {};
  render() {
    return (
      <svg
        xmlns="http://www.w3.org/2000/svg"
        width="20"
        height="20"
        viewBox="0 0 24 24"
        fill="none"
        stroke="#404040"
      >
        <path d="M5 12h13M12 5l7 7-7 7" />
      </svg>
    );
  }
}

export default BackIcon;
